import React, { Fragment } from "react";
import axios from "axios";
import {useEffect, useState } from "react"; //to use function to get information  and useState to store data
import { BrowserRouter as Router, Route, Routes,Navigate } from "react-router-dom";
import { Navigation, Home, Contact, SignUp, SignIn, DoctInfo, Logout, DoctAss,Profileusers } from "./components";
function App() {
  const [isauthenticated, setisauthenticated] = useState(false);
  const [username, setusername] = useState('');
  const [countdrassignment, setcountdrassignment] = useState(0);
  const [countalldoctor, setcountalldoctor] = useState(0);



  useEffect(() => {
    axios.get("http://localhost:4000/signin", { withCredentials: true })
      .then(res => {
        setisauthenticated(res.data.isauthenticated);
        setusername(res.data.username);
        setcountdrassignment(res.data.countdrassignment);
        setcountalldoctor(res.data.countalldoctor);
      }).catch(error => console.log(error));
  })



  //#region  Routers
  function RouterDocAss() {
    if (isauthenticated) {
      return (
        <Route exact path="/doctorAPP" element={<DoctAss />} />
      )
    }
  }
  function RouterDocAss() {
    if (isauthenticated) {
      return (
        <Route exact path="/doctorAPP" element={<DoctAss />} />
      )
    }
  }
  function RouterHome() {
    if (true) {
      return (
        <Route exact path="/" element={<Home />} />
      )
    }
  }
  function RouterLogout() {
    if (isauthenticated) {
      return (
        <Route exact path="/logout" element={<Logout />} />
      )
    }
    else {
      return (
        <Route path="/logout" element={<Navigate replace to="/" />} />
      )
    }
  }
  function RouterSignUp() {
    if (!isauthenticated) {
      return (
        <Route path="/signup" element={<SignUp />} />
      )
    }
    else {
      return (
        <Route path="/signup" element={<Navigate replace to="/doctorAPP" />} />
      )
    }
  }
  function RouterSignIn() {
    if (!isauthenticated) {
      return (
        <Route path="/signin" element={<SignIn />} />
      )
    }
    else {
      return (
        <Route path="/signin" element={<Navigate replace to="/doctorAPP" />} />
      )
    }
  }
  function RouterContact() {
    if (true) {
      return (
        <Route path="/contact" element={<Contact />} />
      )
    }
  }
  function RouterDoctInfo() {
    if (isauthenticated) {
      return (
        <Route path="/doctorNotAPP" element={<DoctInfo countalldoctor={countalldoctor} countdrassignment={countdrassignment} isauthenticated={isauthenticated} />} />
      )
    }
    else {
      return (
        null
      )
    }
  }
  //#endregion

  return (
    <div className="App">
      <Router>
        <Navigation countalldoctor={countalldoctor} countdrassignment={countdrassignment} isauthenticated={isauthenticated} username={username} />
        <Routes>
          {RouterHome()}
          {RouterSignUp()}
          {RouterContact()}
          {RouterDoctInfo()}
          {RouterSignIn()}
          {RouterLogout()}
          {RouterDocAss()}
        </Routes>
      </Router>
    </div>
  );
}
export default App;
